import React, { Component } from "react";
import '../Pages/assets/css/ProductDetail.css';

import Navigation from '../Component/Navbar_Sebelum_Login';
import Footer from '../Component/Footer';
import ListDetail from "../Component/ListDetail";

class ProductDetailPage extends Component {
  render() {
    return (
        <section>
        <Navigation/>
        <div className="container">
            <div className="card">
                <div className="container-fliud">
                    <div className="wrapper row">
                        { this.props.listMobil[0].map((item, key) => {
                            const merk_mobil = item.merk_mobil !== null ? item.merk_mobil : "";
                            const model_mobil = item.model_mobil !== null ? item.model_mobil : "";
                            const transmisi = item.transmisi !== null ? item.transmisi : "";
                            const jarak_tempuh = item.jarak_tempuh !== null ? item.jarak_tempuh : "";
                            const tahun = item.tahun !== null ? item.tahun : "";
                            const tipe_bahan_bakar = item.tipe_bahan_bakar !== null ? item.tipe_bahan_bakar : "";
                            const warna_mobil = item.warna_mobil !== null ? item.warna_mobil : "";
                            const harga = item.harga !== null ? item.harga : "";
                            const judul_lapak = item.judul_lapak !== null ? item.judul_lapak : "";
                            const deskripsi_lapak = item.deskripsi_lapak !== null ? item.deskripsi_lapak : "";
                            return <ListDetail
                            key={
                                key
                            }
                            merk_mobil = {
                                merk_mobil
                            }
                            model_mobil = {
                                model_mobil
                            }
                            transmisi = {
                                transmisi
                            }
                            jarak_tempuh = {
                                jarak_tempuh
                            }
                            tahun = {
                                tahun
                            }
                            tipe_bahan_bakar = {
                                tipe_bahan_bakar
                            }
                            warna_mobil = {
                                warna_mobil
                            }
                            harga = {
                                harga
                            }
                            judul_lapak = {
                                judul_lapak
                            }
                            deskripsi_lapak = {
                                deskripsi_lapak
                            } />
                        })}
                    </div>
                </div>
            </div>
        </div>
        {/* <div className="container">
            <div className="card">
                <div className="container-fliud">
                    <div className="wrapper row">
                        <div className="preview col-md-12">
                            <h3>Deskripsi</h3>
                            <p className="card-text">Lorem ipsum dolor sit amet, consectetur adipisicing elit. Sapiente
                                dicta
                                fugit fugiat hic aliquam itaque facere, soluta. Totam id dolores, sint aperiam sequi
                                pariatur praesentium animi perspiciatis molestias iure, ducimus!</p>
                        </div>
                    </div>
                </div>
            </div>
        </div> */}
        <Footer />
    </section>
    );
  }
}

export default ProductDetailPage;
